import React from "react";
import { Router, Route, Switch } from "react-router";

import Teams from "../models/team/TeamList";

const AppRouter = () => (
  <Router>
    <Switch>
      <Route path="/" component={Teams} />
    </Switch>
  </Router>
);

export default AppRouter;
